B.fb={title:0,subtitle:1,description:2}
B.GH=new A.aY(B.fb,["HapTID","Haptic Technology for Improved Dexterity","Haptic technologies are increasingly used in rehabilitation settings. Stroke victims suffer from severe motor and sensory deficits that handicap their daily lives. HapTID's first purpose is to study and improve dexterity in healthy subjects. It will then be used as a toolkit by researchers and medical professionals to extend the study to post-stroke neuro-rehabilitation. I was able to carry out the literature review, design and fabrication of the system and a study at the Integrative Neuroscience & Cognition Center under the supervision of Lucile Dupin and in collaboration with the Paris Institute of Psychiatry and Neuroscience."],t.l)
B.Hb={title:0,subtitle:1,asset:2,description:3}
B.Gf=new A.aY(B.Hb,["AugmenTip","Fingertip haptic feedback on a budget","images/thimble-quarter.png"," Hands are our main means of physical interaction with our environment, hence the desire to reproduce these sensations artificially and to do without traditional peripherals such as controllers for virtual experiences. In recent years, a number of DIY and open-source projects have emerged that have made haptics more attractive and accessible. One of the best-known projects is LucidGloves, an exoskeleton for the hand that provides kinaesthetic grasping sensations. AugmenTip aims to add cutaneous feedback (contact, pressure and vibration) to all five fingertips within the same DIY and open source framework. This project was carried out at DeVinci Innovation as part of the Creative Technology Engineering master's program."],t.l)
B.GJ=new A.aY(B.fb,["Smart Lock","Smarter lab equipment access control",u.r],t.l)
B.GI=new A.aY(B.fb,["DECIDE","Kickstarter product design project",u.r],t.l)
B.GG=new A.aY(B.fb,["DVIC Signet Ring","Making a graduation ring from scratch for the DVIC students","To celebrate the graduation of the Creative Technology program, I was given the challenge of creating a signet ring to give to the students, reflecting their projects and their pride in belonging to this community. For the first edition, I designed the ring and introduced a manufacturing process based on resin-wax 3D printing and vacuum metal casting to create aesthetic and durable silver rings. The design evokes the themes of the three DVIC groups and projects: technology, nature and humans."],t.l)
